import { get } from "jquery";
import React, { Fragment, useEffect, useState } from "react";

const LowTier = () => {
    const [todos, setTodos] = useState([]);
    const [cpu, setTodos2] = useState([]);
    const [gpu, setTodos3] = useState([]);
    //const []

    const getHardware = async () => {
        try {
            const response = await fetch(`http://localhost:3080/recommend/1`);

            const jsonData = await response.json();

            setTodos(jsonData);

        } catch (err) {
            console.error(err.message);
        }
    };

    // function timeout(delay: number) {
    //     return new Promise(res => setTimeout(res, delay));
    // }

    const getDataCpu = async () => {
        try {
            const response = await fetch(`http://localhost:3080/see/cpu/${todos.id_cpu}`);
            const jsonData = await response.json();

            setTodos2(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    };

    const getDataGpu = async () => {
        try {
            const response = await fetch(`http://localhost:3080/see/gpu/${todos.id_gpu}`);
            const jsonData = await response.json();

            setTodos3(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    };

    const getDataAll = async () => {
        //getDataCpu();
        getDataGpu();
    }

    useEffect(() => {
        async function fetchAPI() {
            getHardware();
            //getData();
        }
        fetchAPI();

    }, []);

    //console.log(cpu);
    //console.log(cpuDesc);

    return (
        <Fragment>

            <div class="row py-0">
                <div class="col-lg-6">
                    <div class="single-project">
                        <img src="images/rekomendasi/lowtier.jpg" alt="" class="img-fluid">
                        </img>
                    </div>
                </div>

                <div class="col-lg-5">


                    <div>
                        <h2>Low Tier</h2>

                        {/* <ShowLowTier todo={todos} /> */}
                        <button type="button" class="btn btn-outline-success" onClick={() => getDataAll()}>
                            Show the Magic
                        </button>

                        <h3>{cpu.name}<br>{gpu.name}</br></h3>


                    </div>


                </div>
            </div>
            <pre class="tab"> </pre>
            <pre class="tab"> </pre>
        </Fragment >
    );
};

export default LowTier;
